import './App.css';
import React from 'react'
import { BrowserRouter, Switch, Route } from 'react-router-dom'
/////////////////////////////////////////////////////// File
import Dasboard from './Component/Dashboard/Dasboard';
import Login from './Login'

function App() {

  return (
    <BrowserRouter>
      <div className="App">
        <Switch>
          <Route path='/' component={Dasboard} />
          <Route path='/abc' component={Login}/>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
